import React from "react";
import Card from "./Card";
import contacts from"../contacts";

function App() {

console.log(contacts);

  return (
    <Card 
     name = {contacts[0].name}
     img = {contacts[0].img}
     tel = {contacts[0].tel}
     email = {contacts[0].email}
    />
  );
}

export default App;
